import React from 'react';
import classes from "./NewsBar.module.css";

const NewsBar = () => {
    return (
        <div className={classes.searchAddFilterContainer}>
            <div className={classes.searchBar}>
                <input type="text" className={classes.searchInput} placeholder="Search..."/>
                <button className={classes.searchButton}>Search</button>
            </div>
            <button className={classes.addButton}>Add</button>
            <div className={classes.filterButtons}>
                <button className={classes.filterButton}>Filter 1</button>
                <button className={classes.filterButton}>Filter 2</button>
                <button className={classes.filterButton}>Filter 3</button>
            </div>
        </div>
    );
};

export default NewsBar;
